import { useRef } from "react";
import { Text } from "react-native";
import { useParams } from "react-router-native";
import { AntDesign } from '@expo/vector-icons';
import { LabelInput } from "../components/input";
import { exerciseStyles } from "../styles/pages";

const Exercise = () => {
    const { categoryName, exerciseName = "Prueba de ejercicio" } = useParams();

    return (<>
        <Text style={exerciseStyles.title}>{exerciseName}</Text>
        <LabelInput text="Peso (kgs)" type="decimal"/>
        <LabelInput text="Repeticiones" type="number"/>
    </>);
}

const NumberInput = () => {
    const inputRef = useRef();
    
    return (<>
        <AntDesign name="minussquareo" size={24} color="black" />
        <LabelInput ref={inputRef} text="Repeticiones" type="number"/>
        <AntDesign name="plussquareo" size={24} color="black" />
    </>);
}

export default Exercise;
